import React from 'react'
import {
    BrowserRouter as Router,
} from "react-router-dom";
import '../styles/reset.less'

function MyApp({ Component, pageProps }) {
    return <Router>
              <Component {...pageProps} />
    </Router>
}

export default MyApp;
